import React, { useEffect, useState } from 'react'
import styled from 'styled-components'

function SubmitButton() {
    return (
        <button>
            I'm a button
        </button>
    );
}

const button = styled.div`
  color: #ffffff;
  padding: 16px;
  font-size: 14px;
  line-height: 1.5;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export default SubmitButton
